import React from "react";

const AddProducts = () => {
  return (
    <div className="d-flex flex-column flex-wrap">
      <div className="container my-3">
        <label for="name">Nama :</label>
        <label for="name">Asal Sekolah :</label>
        <label for="name">Divisi :</label>
        </div>

        <div className="container my-3">
            <input type="text" id="name" className="mx-2"/>
            <input type="text" id="asal" className="mx-2"/>
        </div>

        <div className="container my-3">
            <label for="divisi">Divisi :
            </label>
            <input type="text" id="divisi" className="mx-2"/>
        </div>
    </div>
  );
};

export default AddProducts;
